DROP TABLE IF EXISTS `phb_add_rate`;
CREATE TABLE `phb_add_rate` (
  `rate_id` int(10) NOT NULL AUTO_INCREMENT,
  `rate_name` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '加息劵名',
  `annualized_rate` decimal(5,3) DEFAULT NULL COMMENT '年化利率',
  `rate_flag` varchar(20) DEFAULT NULL COMMENT '运算符  equal  equalorgreaterthan  equalorsmallerthan',
  `rate_period` tinyint(3) DEFAULT NULL COMMENT '期限  用来规定这个加息劵的使用在那种产品上',
  `rate_status` tinyint(1) DEFAULT NULL COMMENT '状态   0:失效 1:有效',
  `amount_flag` varchar(20) DEFAULT NULL COMMENT '使用规则额度前的条件  运算符  equal  equalorgreaterthan  equalorsmallerthan',
  `rate_amount` int(11) DEFAULT NULL COMMENT '使用的额度',
  `rate_lastdays` tinyint(3) DEFAULT NULL COMMENT '领取后多少天后过期',
  PRIMARY KEY (`rate_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1 COMMENT='加息劵';

