-- ----------------------------
--  Table structure for `phb_asset_product`
-- ----------------------------
DROP TABLE IF EXISTS `phb_asset_product`;
CREATE TABLE `phb_asset_product` (
  `product_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `product_name` varchar(120) NOT NULL COMMENT '产品名',
  `payment_method` varchar(120) NOT NULL COMMENT '还款方式',
  `guarantee_method` varchar(120) NOT NULL COMMENT '保障方式',
  `redemption_due_rate` decimal(5,2) unsigned NOT NULL COMMENT '到期赎回率',
  `redemption_early_rate` decimal(5,2) unsigned NOT NULL COMMENT '提前赎回率',
  `investment_amount_min` int(10) unsigned NOT NULL COMMENT '最小投资额',
  `investment_amount_multiple` decimal(5,2) unsigned NOT NULL COMMENT '投资额递增倍数',
  `investment_amount_upper` int(10) unsigned DEFAULT '0' COMMENT '单笔额度上限',
  `product_sn` varchar(60) NOT NULL COMMENT '编号',
  `annualized_rate` decimal(5,3) NOT NULL COMMENT '年化利率',
  `reward_rate` decimal(5,2) unsigned DEFAULT '0.00' COMMENT '奖励利率',
  `start_date` date DEFAULT NULL COMMENT '加入期',
  `end_date` date DEFAULT NULL COMMENT '到期日',
  `period` tinyint(3) unsigned DEFAULT NULL,
  `join_rate` decimal(5,2) unsigned DEFAULT '0.00' COMMENT '加入费率',
  `management_rate` decimal(5,2) unsigned DEFAULT '0.00' COMMENT '管理费率',
  `redemption_due_method` varchar(120) DEFAULT '' COMMENT '到期赎回方式',
  `redemption_early_method` varchar(120) DEFAULT '' COMMENT '提前赎回方式',
  `create_time` datetime DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `total_amount` bigint(20) unsigned NOT NULL,
  `current_amount` bigint(20) unsigned DEFAULT '0',
  `unit` varchar(10) DEFAULT '月',
  `product_desc` text,
  `help` varchar(255) DEFAULT '',
  `type` tinyint(4) DEFAULT '1' COMMENT '2:朗月赢 3:金元宝 4:年年红',
  `status` tinyint(3) unsigned DEFAULT '1',
  `important` tinyint(2) DEFAULT NULL,
  PRIMARY KEY (`product_id`),
  UNIQUE KEY `product_sn` (`product_sn`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;

