-- ----------------------------
--  Table structure for `phb_item_investment`
-- ----------------------------
DROP TABLE IF EXISTS `phb_item_investment`;
CREATE TABLE `phb_item_investment` (
  `investment_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `m_user_id` int(10) unsigned NOT NULL,
  `item_sn` varchar(60) NOT NULL COMMENT '编号',
  `investment_amount` int(10) unsigned NOT NULL COMMENT '投资金额',
  `status` tinyint(3) unsigned DEFAULT '0' COMMENT '募集中0、收益中1、到期赎回2、提前赎回3',
  `income_date` date NOT NULL COMMENT '计息日期',
  `last_income` decimal(10,2) DEFAULT '0.00' COMMENT '最终收益',
  `last_date` date DEFAULT NULL COMMENT '最后收益日期',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`investment_id`),
  KEY `item_sn` (`item_sn`),
  KEY `m_user_id` (`m_user_id`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `phb_loan_item`
-- ----------------------------
DROP TABLE IF EXISTS `phb_loan_item`;
CREATE TABLE `phb_loan_item` (
  `item_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `loan_id` mediumint(8) unsigned NOT NULL,
  `item_sn` varchar(60) NOT NULL,
  `current_amount` bigint(20) unsigned DEFAULT '0' COMMENT '已投资额度',
  `total_amount` bigint(20) unsigned NOT NULL COMMENT '总投资额度',
  `status` tinyint(3) unsigned DEFAULT '0',
  `payment_method` varchar(120) NOT NULL COMMENT '还款方式',
  `guarantee_method` varchar(120) NOT NULL COMMENT '保障方式',
  `investment_amount_min` int(10) unsigned NOT NULL COMMENT '最小投资额',
  `annualized_rate` decimal(5,3) NOT NULL COMMENT '年化利率',
  `period` tinyint(3) unsigned DEFAULT NULL,
  `item_desc` text,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_time` datetime DEFAULT NULL,
  `start_date` date NOT NULL COMMENT '起始日期',
  `end_date` date NOT NULL COMMENT '结束日期',
  PRIMARY KEY (`item_id`),
  UNIQUE KEY `item_sn` (`item_sn`),
  KEY `loan_id` (`loan_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

