-- ----------------------------
--  Table structure for `phb_mobile_user`
-- ----------------------------
DROP TABLE IF EXISTS `phb_mobile_user`;
CREATE TABLE `phb_mobile_user` (
  `m_user_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `m_user_name` varchar(50) NOT NULL,
  `m_user_tel` varchar(32) DEFAULT '',
  `m_user_email` varchar(50) DEFAULT '',
  `m_user_pwd` varchar(50) DEFAULT '',
  `pay_password` varchar(50) DEFAULT '',
  `third_party` varchar(255) DEFAULT NULL,
  `photo` char(32) DEFAULT NULL,
  `sex` tinyint(4) DEFAULT '1',
  `age` tinyint(4) DEFAULT '0',
  `occupation` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `parent_id` int(10) unsigned DEFAULT '0',
  `frozen_money` decimal(10,2) unsigned DEFAULT '0.00',
  `m_user_money` decimal(10,2) DEFAULT '0.00',
  `id_number` char(18) NOT NULL COMMENT '身份证号',
  `emergency_name` varchar(60) DEFAULT '' COMMENT '紧急联系人姓名',
  `emergency_phone` varchar(32) DEFAULT '' COMMENT '紧急联系人手机号',
  `emergency_relation` varchar(60) DEFAULT '' COMMENT '紧急联系人关系',
  `id_photo` char(32) DEFAULT '' COMMENT '身份证正面',
  `id_photo_hand` char(32) DEFAULT '' COMMENT '手持身份证正面',
  `is_audit` tinyint(4) DEFAULT '0' COMMENT '身份证人工审核',
  `id_photo_back` char(32) DEFAULT '',
  `nickname` varchar(50) DEFAULT '' COMMENT '昵称',
  `constellation` varchar(25) DEFAULT '' COMMENT '星座',
  `liveness` tinyint(4) DEFAULT '0' COMMENT '活跃度',
  `level` tinyint(3) unsigned DEFAULT '0' COMMENT '用户级别',
  `social_status` varchar(30) DEFAULT '' COMMENT '个人签名',
  `picturewall` varchar(500) DEFAULT '' COMMENT '个人主页照片墙，多个照片的字符串',
  `user_province` varchar(20) DEFAULT NULL,
  `user_city` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`m_user_id`),
  UNIQUE KEY `m_user_tel` (`m_user_tel`)
) ENGINE=InnoDB AUTO_INCREMENT=5425 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

