-- ----------------------------
--  Table structure for `phb_month_balance`
-- ----------------------------
DROP TABLE IF EXISTS `phb_month_balance`;
CREATE TABLE `phb_month_balance` (
  `yyyymm` char(6) NOT NULL COMMENT '年月',
  `pay_amount` decimal(10,2) DEFAULT '0.00' COMMENT '本月公司账户收入(充值)',
  `investment_income` decimal(10,2) DEFAULT '0.00' COMMENT '本月投资收益',
  `loan_interest` decimal(10,2) DEFAULT '0.00' COMMENT '本月授信贷款月息',
  `total_asset` decimal(10,2) DEFAULT '0.00' COMMENT '用户总资产',
  `total_asset_last` decimal(10,2) DEFAULT '0.00' COMMENT '上月用户总资产',
  `withdraw_amount` decimal(10,2) DEFAULT '0.00' COMMENT '本月公司账户支出(提现)',
  `balance` decimal(10,2) DEFAULT '0.00' COMMENT '公司账户余额',
  `status` tinyint(3) unsigned DEFAULT '1' COMMENT '账务状态',
  PRIMARY KEY (`yyyymm`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `phb_muser_account`
-- ----------------------------
DROP TABLE IF EXISTS `phb_muser_account`;
CREATE TABLE `phb_muser_account` (
  `account_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `m_user_id` int(10) unsigned NOT NULL,
  `amount` decimal(10,2) NOT NULL COMMENT '账户金额',
  `process_type` tinyint(4) DEFAULT '0' COMMENT '0:充值 1:取现',
  `admin_user` varchar(50) DEFAULT NULL,
  `admin_note` varchar(255) DEFAULT '',
  `user_note` varchar(255) DEFAULT '',
  `is_paid` tinyint(4) DEFAULT '0' COMMENT '2:退款完成  ',
  `create_time` datetime DEFAULT '0000-00-00 00:00:00',
  `paid_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `order_id` char(32) DEFAULT '' COMMENT '订单号',
  PRIMARY KEY (`account_id`),
  KEY `m_user_id` (`m_user_id`),
  KEY `is_paid` (`is_paid`),
  KEY `order_id` (`order_id`),
  KEY `paid_time` (`paid_time`)
) ENGINE=InnoDB AUTO_INCREMENT=4516 DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;

-- ----------------------------
--  Table structure for `phb_muser_account_log`
-- ----------------------------
DROP TABLE IF EXISTS `phb_muser_account_log`;
CREATE TABLE `phb_muser_account_log` (
  `log_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `m_user_id` int(10) unsigned NOT NULL,
  `change_type` varchar(50) NOT NULL COMMENT '交易类型',
  `change_desc` varchar(50) DEFAULT '' COMMENT '交易说明',
  `amount` decimal(10,2) NOT NULL COMMENT '金额',
  `balance_amount` decimal(10,2) NOT NULL COMMENT '可用余额',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `account_type` tinyint(3) unsigned DEFAULT '0' COMMENT '0: 提现 1:充值   2: 下线投资提成 3:理财体验收益 4:投资 5:红包抵资 6:投资收益 7:投资赎回 8:提现冻结 9:提现取消 10:退款完成等待入账 11:授信贷款 12授信贷款月息 13:授信贷款还本 14:投资平仓 15:贷款平仓',
  `from_user` int(10) unsigned DEFAULT '0' COMMENT '用于统计提成',
  PRIMARY KEY (`log_id`),
  KEY `m_user_id` (`m_user_id`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=41939 DEFAULT CHARSET=utf8;

-- ----------------------------
