  `expire_Date` date DEFAULT NULL COMMENT '到期日',
  `total_income` decimal(10,0) DEFAULT NULL COMMENT '预期总收入',
  `annualized_rate` decimal(5,3) DEFAULT NULL COMMENT '当前这笔投资的年利率,可能是产品利率+加息劵的利率',
  PRIMARY KEY (`investment_id`),
  KEY `m_user_id` (`m_user_id`),
  KEY `bid_sn` (`bid_sn`) USING BTREE,
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=1048 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `phb_muser_loan`
-- ----------------------------
DROP TABLE IF EXISTS `phb_muser_loan`;
CREATE TABLE `phb_muser_loan` (
  `loan_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `m_user_id` int(10) unsigned NOT NULL,
  `useage` tinyint(4) DEFAULT '0' COMMENT '用途',
  `amount` bigint(20) unsigned NOT NULL COMMENT '贷款额度',
  `period` tinyint(4) unsigned NOT NULL COMMENT '贷款期限',
  `create_time` datetime DEFAULT NULL,
  `type` tinyint(3) unsigned DEFAULT '1' COMMENT '类型',
  `status` tinyint(3) unsigned DEFAULT '0' COMMENT '收益中1、到期赎回2、提前赎回3、平仓4',
  `give_date` date DEFAULT NULL COMMENT '放款日期',
  `last_return` decimal(10,2) DEFAULT '0.00' COMMENT '总还款额',
  `rate` decimal(5,3) DEFAULT NULL COMMENT '贷款利率',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `repayment` int(10) unsigned DEFAULT '0',
  `real_amount` int(10) unsigned DEFAULT '0',
  `last_date` date DEFAULT NULL COMMENT '最后还款日期',
  `user_files` int(10) DEFAULT NULL,
  PRIMARY KEY (`loan_id`),
  KEY `m_user_id` (`m_user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=147 DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;

