-- ----------------------------
--  Table structure for `phb_resource_type`
-- ----------------------------
DROP TABLE IF EXISTS `phb_resource_type`;
CREATE TABLE `phb_resource_type` (
  `type_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '名称',
  `icon` varchar(255) NOT NULL COMMENT '图标',
  `default_image` varchar(255) NOT NULL COMMENT '默认图片',
  PRIMARY KEY (`type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
--  Table structure for `phb_role`
-- ----------------------------
DROP TABLE IF EXISTS `phb_role`;
CREATE TABLE `phb_role` (
  `role_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `role_name` varchar(50) NOT NULL DEFAULT '',
  `role_desc` varchar(255) NOT NULL DEFAULT '',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `create_time` datetime DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`role_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `phb_role_menu`
-- ----------------------------
DROP TABLE IF EXISTS `phb_role_menu`;
CREATE TABLE `phb_role_menu` (
  `role_id` tinyint(3) unsigned NOT NULL,
  `menu_id` tinyint(3) unsigned NOT NULL,
  KEY `role_id` (`role_id`),
  KEY `menu_id` (`menu_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `phb_third_pay_account`
-- ----------------------------
DROP TABLE IF EXISTS `phb_third_pay_account`;
CREATE TABLE `phb_third_pay_account` (
  `yb_order_id` char(18) NOT NULL COMMENT '消费交易流水号',
  `order_id` char(32) NOT NULL COMMENT '客户消费订单号',
  `amount` decimal(10,2) NOT NULL COMMENT '实收金额',
  `fee` decimal(10,2) NOT NULL COMMENT '收款方手续费',
  `type` varchar(50) NOT NULL COMMENT '充值、退款',
  `pay_date` varchar(50) NOT NULL COMMENT '交易时间',
  PRIMARY KEY (`yb_order_id`),
  KEY `pay_date` (`pay_date`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `phb_third_pay_log`
-- ----------------------------
DROP TABLE IF EXISTS `phb_third_pay_log`;
CREATE TABLE `phb_third_pay_log` (
  `log_id` char(32) NOT NULL,
  `action` varchar(255) NOT NULL,
  `params` text,
  `status` tinyint(3) unsigned DEFAULT '0' COMMENT '1=成功',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `error` varchar(255) DEFAULT '',
  PRIMARY KEY (`log_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

